import { Link } from 'react-router-dom';

export const Nav = ({ loggedin, handleLogout}) => {


    return (
        <nav>
        <ul className="nav-links">
           <a href="/">
        </a>
        <Link style={{color: "white"}} to="/">
            <li>Poems</li>
          </Link>
          <Link>
          {loggedin ? 
              <>
                <Link onClick={handleLogout}>Logout</Link> 
                <Link eventKey={2} href="profile">Account</Link> 
                </>: 
              <>
                <Link style={{color: "white"}} href="login">Login</Link>
                <Link style={{color: "white"}} eventKey={2} href="register">Register</Link> 
                </>}
                </Link>

        </ul>
      </nav>
    );
  }

